8\000\128\000\128\000\128\000\128\000\128\000\128\000\128\000\128\000\128\000\128\000\128\000\000")}
tunnel = {}
trail = {}
tunnelLength = 32
trailLength = 5
blockWidth = 10
floatingX = 64
floatingY = 0
floatingSize = 50
gapSize = 150
windowCenterX = 159
windowCenterY = 106
initDotPosition = 100
dotPosition = initDotPosition
stepSize = 10
velocity = 0
score = 0
bestScore = 0
surpriseFactor = 3
onTitleScreen = true
collision = false
countdown = false
restart = false
crashAnimation = false
surprise = false
surpriseStep = 0.5
surpriseNow = 0
surpriseLength = 0
crashCircleRadius = 200
speed = 100
magic = "b4v96n9zte"
timeNewGame = 0
timeSpeedIncreased = timer.getMilliSecCounter()
timeGenerated = timer.getMilliSecCounter()
math.randomseed(timer.getMilliSecCounter())

function initTunnel(value)
    for i = 1, tunnelLength do
        tunnel[i] = value
    end
end

function initTrail(value)
    for i = 1, trailLength do
        trail[i] = value
    end
end

function resetSettings()
    timeNewGame = 0
    dotPosition = initDotPosition
    velocity = 0
    gapSize = 150
    crashCircleRadius = 200
    speed = 100
    floatingX = 64
    score = 0
    collision = false
    restart = false
    initTunnel(windowCenterY - (gapSize / 2))
    initTrail(dotPosition)
end

function generateTunnel()
    for i = 1, tunnelLength - 1 do
        tunnel[i] = tunnel[i + 1]
    end
    local new
    if surprise then
        new = tunnel[tunnelLength - 1] + (surpriseStep * stepSize)
        if new < 0 or 212 - (new + gapSize) < 0 then
            surpriseStep = -surpriseStep
            new = tunnel[tunnelLength - 1] + (surpriseStep * stepSize)
        end
        if surpriseNow > surpriseLength then
            surprise = false
            surpriseNow = 0
            surpriseLength = 0
        end
        surpriseNow = surpriseNow + 1
    else
        new = tunnel[tunnelLength - 1] + (math.random(-1, 1) * stepSize)
        if new < 0 or 212 - (new + gapSize) < 0 then
            if math.random(1, 10) <= surpriseFactor then
                surprise = true
                surpriseLength = math.random(10, 50)
            end
            if new < 0 then
                new = 0
            else
                new = new - stepSize
            end
        end
    end
    tunnel[tunnelLength] = new
    if floatingX > 0 then
        floatingX = floatingX - 1
    else
        floatingX = tunnelLength
        floatingY = math.random(tunnel[tunnelLength],
                                tunnel[tunnelLength] + gapSize - floatingSize)
    end
end

function addTrail(position)
    for i = 1, trailLength - 1 do
        trail[i] = trail[i + 1]
    end
    trail[trailLength] = position
end

function drawTitleScreen(gc)
    local bestScoreLength = tostring(bestScore):len()
    gc:drawImage(titleScreen, 0, 0)
    gc:drawImage(ranks[rankByScore(bestScore)],
                 windowCenterX - ((bestScoreLength * 10) / 2) - 42, 105)
    drawNumber(gc, bestScore,
               windowCenterX - ((bestScoreLength * 10) / 2) - 22, 107)
end

function drawTunnel(gc)
    gc:setColorRGB(0, 0, 0)
    for i = 1, tunnelLength do
        gc:fillRect((i - 1) * blockWidth, 0, blockWidth, tunnel[i])
        gc:fillRect((i - 1) * blockWidth, tunnel[i] + gapSize,
                    blockWidth, 212 - (tunnel[i] + gapSize) + 1)
        if i == floatingX and not countdown then
            gc:fillRect((i - 1) * blockWidth, floatingY,
                        blockWidth, floatingSize)
        end
    end
end

function drawDot(gc)
    gc:setColorRGB(0, 0, 0)
    gc:fillRect(30, dotPosition, 5, 5)
end

function drawTrail(gc)
    for i = 1, trailLength do
        local color = 255 - (i * 40)
        gc:setColorRGB(color, color, color)
        gc:fillRect(3 * (i - 1) + 15, trail[i] + 1, 3, 3)
    end
    gc:setColorRGB(0, 0, 0)
end

function drawNumber(gc, number, x, y)
    local s = tostring(number)
    local length = #s
    for i = 1, length do
        gc:drawImage(digits[tonumber(s:sub(i, i)) + 1], x + ((i - 1) * 10), y)
    end
end

function isCollision()
    return dotPosition < tunnel[4]
        or dotPosition + 5 > tunnel[4] + gapSize
        or (floatingX == 4
        and dotPosition + 5 > floatingY
        and dotPosition < floatingY + floatingSize)
end

function rankByScore(score)
    local rank
    if score >= 2500 then
        rank = 12
    elseif score >= 2250 then
        rank = 11
    elseif score >= 2000 then
        rank = 10
    elseif score >= 1750 then
        rank = 9
    elseif score >= 1500 then
        rank = 8
    elseif score >= 1250 then
        rank = 7
    elseif score >= 1000 then
        rank = 6
    elseif score >= 750 then
        rank = 5
    elseif score >= 500 then
        rank = 4
    elseif score >= 300 then
        rank = 3
    elseif score >= 150 then
        rank = 2
    elseif score < 150 then
        rank = 1
    end
    return rank
end

function on.timer()
    timer.stop()
    platform.window:invalidate()
end

function on.contextMenu()
    if onTitleScreen then
        return
    end
    resetSettings()
    drawTitleScreen(platform.gc())
    onTitleScreen = true
    platform.window:invalidate()
end

function on.enterKey()
    if onTitleScreen then
        onTitleScreen = false
        platform.window:invalidate()
    elseif collision and not crashAnimation then
        restart = true
        collision = false
        platform.window:invalidate() 
    else
        on.tabKey()
    end
end

function on.tabKey()
    if collision or countdown or onTitleScreen then
        return
    end
    velocity = velocity - 1
    dotPosition = dotPosition + velocity
end

function on.create()
    resetSettings()
    bestScore = var.recall(magic) or 0
end

function on.paint(gc)
    if onTitleScreen then
        drawTitleScreen(gc)
        return
    end
    drawTunnel(gc)
    drawDot(gc)
    drawTrail(gc)
    drawNumber(gc, score, 2, 198)
    drawNumber(gc, bestScore,
               317 - (tostring(bestScore):len() * 10), 198)
    if collision or isCollision() then
        collision = true
        if score > bestScore then
            bestScore = score
            var.store(magic, bestScore)
        end
        gc:setColorRGB(50, 50, 50)
        gc:setPen("medium", "dotted")
        if crashCircleRadius > 20 then
            crashCircleRadius = crashCircleRadius - 2
            crashAnimation = true
        else
            crashAnimation = false
        end
        gc:drawArc(30 - crashCircleRadius + 2,
                   dotPosition - crashCircleRadius + 2,
                   crashCircleRadius * 2, crashCircleRadius * 2,
                   0, 360)
        gc:drawImage(scoreRankText,
                     windowCenterX - 18,
                     69)
        drawNumber(gc, score,
                   windowCenterX - ((tostring(score):len() * 10) / 2), 83)
        gc:drawImage(ranks[rankByScore(score)], windowCenterX - 8, 115)
        if restart then
            resetSettings(gc)
            gc:setColorRGB(0, 0, 0)
            gc:setPen("thin", "smooth")
        end
    end
    local timeNow = timer.getMilliSecCounter()
    if timeNow - timeSpeedIncreased > 750
   and speed - 0.2 >= 30 then
        speed = speed - 0.2
        timeSpeedIncreased = timeNow
    end
    if not collision then
        if timeNewGame == 0 then
            timeNewGame = timeNow
        end
        if timeNow - timeNewGame < 3000 then
            countdown = true
            drawNumber(gc, 4 - math.ceil((timeNow - timeNewGame) / 1000),
                       windowCenterX - 5, 10)
            gc:drawImage(helpText,
                         windowCenterX - 57, windowCenterY - 24)
        elseif timeNow - timeGenerated >= speed then
            countdown = false
            timeGenerated = timeNow
            if gapSize - 0.02 >= 70 then
                gapSize = gapSize - 0.02
            end
            generateTunnel()
            addTrail(dotPosition)
            score = score + 1
        end
        if not countdown then
            velocity = velocity + 0.06
            dotPosition = dotPosition + velocity
        end
    end
    timer.start(0.01)
end